import React from 'react'
import TodoForm from './TodoForm'

export default function Todo({todo, index, addTodo, deleteTodo}) {



    return (
        <div>
            <h4>{todo.name}</h4>
            { todo.todos.map(todo => {
                return (
                    <div>
                        <Todo todo={todo} />
                    </div>
                )
            }) }
            <div>
                <TodoForm category={todo.id}  addTodo={addTodo}/>
            </div>
        </div>
    )
}
